curBlockNumber = 0


def getTrainInfo():
    resp = requests.post(args.rpc_url, json={
        "jsonrpc": "2.0",
        "method": "eth_getTrainInfo",
        "params": [],
        "id": 1
    })
    data = resp.json()
    return data['result']


def getNetGlobEmpty():
    trainInfo = getTrainInfo()
    if trainInfo['model_name'] == "cnn":
        model = CNN(num_channels=trainInfo['num_channels'], num_classes=trainInfo['num_classes'])
    return model


def getNetGlob():
    global curBlockNumber
    model = getNetGlobEmpty()

    data = requests.post(args.rpc_url, json={
        "jsonrpc": "2.0",
        "method": "eth_getBlockByNumber",
        "params": [
            'latest',
            True
        ],
        "id": 1
    }).json()
    result = data['result']
    curBlockNumber = int(result['number'], 16)
    try:
        stateDict = hexToStateDict(result['extraData'][2:])
        model.load_state_dict(stateDict)
    except:
        print('init')

    return model


def waitNewGlobalModel():
    global curBlockNumber
    while True:
        data = requests.post(args.rpc_url, json={
            "jsonrpc": "2.0",
            "method": "eth_blockNumber",
            "params": [],
            "id": 83
        }).json()
        result = data['result']
        blockNumber = int(result, 16)
        if blockNumber == curBlockNumber:
            time.sleep(5)
            continue
        curBlockNumber = blockNumber
        break


def uploadWeights(net_glob):
    data = stateDictToHex(net_glob.state_dict())
    # data = ''
    requests.post(args.rpc_url, json={
        "jsonrpc": "2.0",
        "method": "eth_newLocalModel",
        "params": [
            args.address,
            data
        ],
        "id": 1
    })


def register(dataSize):
    resp = requests.post(args.rpc_url, json={
        "jsonrpc": "2.0",
        "method": "eth_register",
        "params": [
            args.address,
            dataSize
        ],
        "id": 1
    }, headers={
        "Content-Type": "application/json; charset=UTF-8"
    })
