if __name__ == '__main__':
    # alpha = getAlpha(1,1665763756,1665763750.402422,0.003,1,2,3,[[60000, 60000, 60000], [0.2745600022763839, 0.22403049271847902, 0.0], [1, 1, 1], [5.655447718590022, 5.65369673790514, 5.277525000068003]])
    # sio.connect("http://127.0.0.1:5000")
    device = torch.device('mps'.format(args.gpu) if torch.has_mps and args.gpu != -1 else 'cpu')

    if args.dataset == "mnist":
        trans_mnist = transforms.Compose([transforms.ToTensor(), transforms.Normalize((0.1307,), (0.3081,))])
        dataset_train = datasets.MNIST('../data/mnist/', train=True, download=True, transform=trans_mnist)
        dataset_test = datasets.MNIST('../data/mnist/', train=False, download=True, transform=trans_mnist)

        if args.iid:
            dataset_train = iid(dataset_train, args.start_train_index, args.end_train_index)
            dataset_test = iid(dataset_test, args.start_test_index, args.end_test_index)
        else:
            dataset_train = non_iid(dataset_train, args.user_id, args.num_users)
            dataset_test = non_iid(dataset_test, args.user_id, args.num_users)
    elif args.dataset == "cifar":
        if args.iid == False:
            exit("cifar don't support non_iid")
        trans_cifar = transforms.Compose(
            [transforms.ToTensor(), transforms.Normalize((0.5, 0.5, 0.5), (0.5, 0.5, 0.5))])
        dataset_train = datasets.CIFAR10('../data/cifar', train=True, download=True, transform=trans_cifar)
        dataset_test = datasets.CIFAR10('../data/cifar', train=False, download=True, transform=trans_cifar)
    else:
        exit("don't support dataset")

    node = Node(device=device, epoch=args.epoch, dataset_train=dataset_train, dataset_test=dataset_test, lr=args.lr)
    register(len(dataset_train.idxs))
    while True:
        net_glob = getNetGlob().to(device=device)
        node.train(net_glob)
        net_glob.eval()
        acc_test, loss_test = test_img(net_glob, dataset_test, args.epoch, args.gpu)
        uploadWeights(net_glob)
        waitNewGlobalModel()
